import React from 'react';
import { FaAnchor } from "react-icons/fa";
import { IconContext } from "react-icons";
import { motion } from "framer-motion";

import { AiOutlineSetting,AiOutlineBulb,AiOutlineCloudSync } from "react-icons/ai";
import {About, Button, Description, Head, Headings, Logo, Longdescription, Main,MainGrid, Shortdescription, Subgrid1, Subgrid2, SuperSubgrid1} from './Aboutus.elements';
const descriptionMotion = {
    rest: {
      opacity:0,
        y: 30,
      transition: {
        duration: 2,
        type: "tween",
        ease: "easeIn"
      }
    },
    hover: {
     opacity:1,
      y: 0,
      transition: {
        duration: 0.4,
        type: "tween",
        ease: "easeOut"
      }
    }
  };
  
  const logoMotion = {
    rest: { opacity: 1,y:0, ease: "easeOut", duration: 0.2, type: "tween" },
    hover: {
      opacity: 0,
      y:-30,
      transition: {
        duration: 0.4,
        type: "tween",
        ease: "easeIn"
      }
    }
  };
  const headingMotion = {
    rest: { opacity: 1,y:30, ease: "easeOut", duration: 0.2, type: "tween" },
    hover: {
      opacity: 1,
      y:0,
      transition: {
        duration: 0.4,
        type: "tween",
        ease: "easeIn"
      }
    }
  };
function Aboutus() {
    return (
        <IconContext.Provider value={{ color: "blue", size:'50' }}>
        <Main>
            <MainGrid>
                <Subgrid1>

                <About>
                
                    About Us
                </About>
                <Headings>
                Innovating with a Digital Mindset
                </Headings>
                <Shortdescription>
                
                    We are a boutique digital transformation consultancy and development company.   
                </Shortdescription>
                <Longdescription>
                
                Since 2007 we have been a visionary and a reliable software engineering partner for world-class brands. We are a boutique digital transformation consultancy and software development company that provides cutting edge engineering solutions.
                </Longdescription>
                <Button>
                Get In Touch
                </Button>

                </Subgrid1>
                <Subgrid2>
                    <SuperSubgrid1 initial="rest" whileHover="hover" animate="rest">
                        <Logo variants={logoMotion}><FaAnchor ></FaAnchor></Logo>
                        <Head variants={headingMotion}>
Experience Design</Head>
                        <Description variants={descriptionMotion} >

In today’s digital environment, devices and consumers creating an expo nentially growing</Description>
                    </SuperSubgrid1>
                    <SuperSubgrid1>
                        <Logo><AiOutlineSetting></AiOutlineSetting></Logo>
                        <Head>Digital Services</Head>
                        <Description>

In today’s digital environment, devices and consumers creating an expo nentially growing</Description>
                    </SuperSubgrid1>
                    <SuperSubgrid1>
                        <Logo><AiOutlineBulb></AiOutlineBulb></Logo>
                        <Head>Content Engineer</Head>
                        <Description>In today’s digital environment, devices and consumers creating</Description>
                    </SuperSubgrid1>
                    <SuperSubgrid1>
                        <Logo><AiOutlineCloudSync></AiOutlineCloudSync></Logo>
                        <Head>Data Structuring</Head>
                        <Description>In today’s digital environment, devices and consumers creating an expo nentially growing</Description>
                    </SuperSubgrid1>

                </Subgrid2>
            </MainGrid>
        </Main></IconContext.Provider>
    )
}

export default Aboutus
